import styles from './About.module.css';

export default function About() {
  return(
    <div className="styles.divAbout">
      <div className="styles.textAbout">
        <h1>Ricardo</h1>
        <p>Tech enthusiast</p>
      </div>
      <img className="styles.imgAbout" src="" alt=""/>
      </div>
  )
}
